css:
.editor {
  background-color: #2b1b41;
  color: #dcdcdc;
}
.editor .gutter {
  background-color: #2b1b41;
  color: #dcdcdc;
}
.editor .gutter .line-number.cursor-line {
  background-color: rgba(166, 166, 166, 0.07);
  color: #dcdcdc;
}
.editor .gutter .line-number.cursor-line-no-selection {
  color: #dcdcdc;
}
.editor .wrap-guide {
  color: #4ba7ff;
}
.editor .indent-guide {
  color: #4ba7ff;
}
.editor .invisible-character {
  color: #4ba7ff;
}
.editor .search-results .marker .region {
  background-color: transparent;
  border: #4ba7ff;
}
.editor .search-results .marker.current-result .region {
  border: #dcdcdc;
}
.editor.is-focused .cursor {
  border-color: #ffe929;
}
.editor.is-focused .selection .region {
  background-color: #0eb9ff;
}
.editor.is-focused .line-number.cursor-line-no-selection,
.editor.is-focused .line.cursor-line {
  background-color: rgba(166, 166, 166, 0.07);
}
.comment {
  color: #208974;
}
.string {
  color: #FFA3AC;
}
.constant.numeric {
  color: #B241FF;
}
.constant.language {
  color: #FF4B54;
}
.constant.character,
.constant.other {
  color: #29FF1B;
}
.variable.language,
.variable.other {
  color: #FFB444;
}
.keyword {
  color: #0CD8FF;
}
.storage {
  color: #F9F100;
}
.entity.name.class {
  color: #CD005D;
}
.entity.other.inherited-class {
  color: #A1D0FF;
}
.entity.name.function {
  color: #DA417E;
}
.variable.parameter {
  color: #FFF300;
}
.entity.name.tag {
  color: #CEDC76;
}
.entity.other.attribute-name {
  color: #14DC00;
}
.support.function {
  color: #19A0DC;
}
.support.constant {
  color: #77AEDC;
}
.support.type,
.support.class {
  color: #32FB7B;
}
.support.other.variable {
  color: #FF7174;
}
.invalid {
  color: #DC0D00;
}
.constant.character.escaped,
.constant.character.escape,
.string .source,
.string .source.ruby {
  color: #DB2244;
}
